import React, { Component } from "react";
import Navbar from "react-bootstrap/Navbar";
import { Link } from "react-scroll";
import './style.css';

const Nav = () => {
  <div>
    <Navbar bg="dark" variant="dark">
      <Navbar.Brand href="#home">
        <img
          alt=""
          src="/logo.svg"
          width="30"
          height="30"
          className="d-inline-block align-top"
        />{' '}
        React Bootstrap
      </Navbar.Brand>
    </Navbar>
  </div>
}
